import React from "react";
import '../Css/MyCalendarStyle.css'
import { Header } from "../../Header/Header";

export const MyCalendar = () => {
  return (
    <>
      <Header />
      <main className="my-calendar-main">
        <div className="my-calendar-container"></div>
      </main>
    </>
  );
};
